('sv', '_template', 'atutor_accessibility_text', '<p>ATutor inkluderar en variation av funktioner som har designats i syfte att försäkra att innehållet är tillgängligt för alla potentiella användare, inklusive dem som har en långsam internetuppkoppling, gamla webbläsare och människor som har ett handikapp som använder sig utav assisterande tekniker för att komma åt Internet. Dessa funktioner beskrivs i detalj nedan.</p> <ol> <li><b>Förbikopplingslänkar:</b> I det vänstra övre hörnet av ATutor så finns det ett antal förbikopplingslänkar som tillåter assisterande teknikanvändare att hoppa över navigationselementen och gå direkt till innehållet. Tryck på Tabb knappen en gång efter att sidan har laddats klart för att avancera till den första förbikopplingslänken och tryck därefter på Enter för att återpositionera innehållet till den övre delen av bildskärmen. Alternativt, användare kan trycka på Tabb knappen två gånger och Enter för att hoppa direkt till den övre menyarrayen. Tryck på Tabb knappen en tredje gång för att hoppa till den första Tabb (Hem) i navigationen. Press the Tab key a forth time to jump to the Accessibility page (this page) for information on configuring ATutor to work effectively with your assistive technology.<br /><br /> [New in V1.3] The <strong>Menu Bypass</strong> link is dynamically generated to anchor to your last position in the content listings in the menu. To find your way back to a menu listing after opening or closing a menu item, tab into the page after it has finished loading until you reach the Menu Bypass link, then press Enter to jump directly the currently active menu item. </li> <li><b>Default Accessibility Preference Configuration:</b> ATutor has a default accessibility configuration that hides all non-essential images and navigation tools when activated. <b>During registration</b> select \"Enable the Accessibility preferences scheme\" to load the default accessibility settings when you enter ATutor. This removes most of the images from ATutor, and closes the Menu, leaving a pair of sequence links as the primary navigation tools. ATutor\'s accessibility configuration can also be loaded by selecting the <b>Preset Preference</b> labelled \"<a href=\"tools/preferences.php?pref_id=1\">Accessibility</a>\" near the top of the Preferences page. Screen reader users are advised to begin with this default preference setting and then modify those settings later through the Preferences page (if necessary).</li> <li><b>Accesskeys:</b> Keyboard accessibility has been added to many ATutor features. To activate accesskeys, press Alt plus the assigned number or letter as follows: <ul> <li>[Alt 1] Home</li> <li>[Alt 2] Tools</li> <li>[Alt 3] Resources</li> <li>[Alt 4] Discussions</li> <li>[Alt 5] Help</li> <li>[Alt 6] Toggle menus open and closed</li> <li>[Alt 7] Global Menu</li> <li>[Alt 8] Previous topic</li> <li>[Alt 9] Next topic</li> <li>[Alt 0] Resume</li> <li>[Alt y] Main Navigation</li> <li>[Alt m] Menus</li> <li>[Alt j] Jump Menu</li> <li>[Alt s] Submit (active on form pages)</li> <li>[Alt c] Jump to content top (top and bypass link)</li> </ul> <p>Content Editor AccessKeys</p> <ul> <li>[Alt n] Content Tab</li> <li>[Alt p] Properties Tab</li> <li>[Alt k] Keywords Tab</li> <li>[Alt g] Glossary Tab</li> <li>[Alt r] Preview Tab</li> </ul> <p>Chat AccessKeys</p> <ul> <li>[Alt c] Jump to Compose Message field</li> <li>[Alt r] Refresh Messages</li> <li>[Alt m] Jump to Message List</li> <li>[Alt q] Open Chat Help</li> </ul> </li> <li><b>Alternative Text:</b> All images in ATutor include a text alternative that describes the image or its function.</li> <li><b>Alternative Navigation:</b> Global, hierarchical, and sequential navigation tools are available so users can view or structure content in a manner that suits their style of learning. See the Help pages or the ATutor HowTo course for more information about ATutor\'s navigation features.</li> <li><b>Hide Menus:</b> For users of older assistive technologies that do not support columnar text laid out in tables, it is possible to hide ATutor\'s menus so that content will be displayed in a linear presentation. Hiding menus also conserves space for users with smaller monitors.</li> <li><b>Text or Images:</b> ATutor users can choose to have navigational features displayed as either text, icons, or text and icons through a variety of preference settings.</li> <li><b>Form Labels:</b> All form fields throughout ATutor are marked up using the LABEL element to ensure that they are properly described for assistive technology users. Explicit labelling in this manner also makes it possible to click on a form field\'s label to activate the field. This provides a larger target area for those people who have difficulty positioning a mouse pointer on a small form field such as a radio button or a checkbox.</li> <li><b>Style Sheets:</b> Wherever possible, the presentation of content in ATutor is controlled by style sheet elements. This allows users to override ATutor\'s default appearance and apply their own preferred presentation styles (i.e. increased font sizes, different font styles, colours, etc.) </li> <li><b>Form Field Focus:</b> For pages where the primary content is a form, the mouse cursor will automatically be placed in the first field so that after a form page loads, it is not necessary to click or Tab into a field. Rather, users can begin typing text into the form as soon as the page has finished loading.</li> <li><b>Relative Sizing of Images:</b> [New in V1.3] With browsers that support resizing of images, ATutor icons can be magnified for user with low vision, making them more easily visible. (e.g. Netscape 7 press Alt +) </li> </ol>', '2006-06-07 11:17:27', ''),
