('sv', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> är ett Open Source Webbarerat <strong>Learning Content Management System (LCMS)</strong> designat med tanke på tillgänglighet och anpassningsbarhet. Administratörer kan installera och uppdatera ATutor på några minuter. Lärare kan snabbt plocka ihop, packa och distrubiera undervisningsmaterial, \r\noch leda sina kurser online. Studenter lär sig i en anpassningsbar miljö.', '2006-04-13 15:04:05', ''),
('sv', '_template', 'atutor_links', '<p>Lär dig med om <a href=\"http://atutor.ca/index.php\">ATutor</a> genom följande länkar:</p> <ul> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQs</a> - Vanliga frågor med svar</li> <li><a href=\"http://atutor.ca/forums/index.php\">Supportforum</a> - Skriv i användarforum</li> <li><a href=\"http://atutor.ca/services/index.php\">Supportservis</a> - Om du behöver vår hjälp, finns supporten tillänglig</li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Översättning</a> - Ladda ner språkpaket, bli en översättare</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Licenser</a> - ATutor mjukvara är tillängligt gratis under vissa förutsättningar </li> <li><a href=\"http://atutor.ca/atutor/download.php\">Ladda ner ATutor</a> - All systemmjukvara som behövs för att köra ATutor kan laddas ner här</li> </ul>', '2006-04-13 15:09:18', ''),
