('sv', '_template', 'chat_help_display_blurb', '[chat_help_display_blurb]\r\n<p>Note: <em>Jump To</em> links and the <em>Quick Key</em> list only appear if you have turned on <em>Navigation Aids</em> in you preferences.</p> <ul> <li>The <em>Jump to Quick Keys</em> link at the top takes you to a list of quick keys for the Chat. </li> <li>The <em>Message Area</em> displays the most recent messages (up to ten). </li> <li>The <em>Jump to Messages</em> links take you to the beginning of the list of messages. (Alt+M) </li> <li>The <em>Refresh Messages</em> link lets you check for new messages (Alt+R). </li> <li>The <em>Compose Message</em> Field and <em>Send Button</em> let you enter and send messages (Alt+C to enter the Compose Field, Enter to send a completed message). </li> </ul>', '2006-04-16 09:09:14', ''),
